import React from 'react';
import ProjectItem from '../Components/ProjectItem';
//import Proj1 from '../Images/Project1.png';
import './Projects.css';

function Projects() {
  return (
    <div className="projects">
      <h1>My Projects</h1>
      <div className="projectList">
        <ProjectItem name="Project 1" image = 'app/src/Assets/UnityImage.jpg'/>
        <ProjectItem name="Project 2" image = 'app/src/Assets/UnrealImage.jpg'/>
      </div>
    </div>
  );
}

export default  Projects;
